import { startTransition } from "react";
import "./ExpenseItem.css";

function ExpenseItem() {
  return (
    <div className="row" style={rowStyle}>
      <div className="col-xs-4" style={(itemDescription, expenseItem)}>
        June 20th 2022
      </div>
      <div className="col-xs-4" style={itemDescription}>
        Car Insurance
      </div>
      <div className="col-xs-4" style={itemDescription}>
        $184.00
      </div>
    </div>
  );
}

const rowStyle = {
  display: "flex",
  justifyVontent: "space-between",
  alignItems: "center",
  boxShadow: "0 2 8 rgba(0, 0, 0, 0.25)",
  padding: "0.5rem",
  margin: "1rem 0",
  borderRadius: "12px",
  backgroundColor: "#4b4b4b",
};

const itemDescription = {
  display: "flex",
  flexDirection: "column",
  gap: "1rem",
  alignItems: "flex-end",
  flexFlow: "column-reverse",
  justifyContent: "flex-startTransition",
  flex: 1,
};

const expenseItem = {
  color: "#3a3a3a",
  fontSize: "1rem",
  flex: "1",
  margin: "0 1rem",
  textColor: "white",
};

